--
-- Описание для таблицы Courses
--
DROP TABLE IF EXISTS Courses;
CREATE TABLE Courses (
  id           INT(11)      NOT NULL AUTO_INCREMENT,
  name         VARCHAR(255) NOT NULL,
  start        TIMESTAMP    NULL     DEFAULT NULL,
  finished     TINYINT(1)            DEFAULT NULL,
  price        DECIMAL(19, 2)        DEFAULT NULL,
  teacher_name VARCHAR(255)          DEFAULT NULL,
  schedule     VARCHAR(255)          DEFAULT NULL,
  notes        VARCHAR(999)          DEFAULT NULL,
  PRIMARY KEY (id)
)
  ENGINE = INNODB
  AUTO_INCREMENT = 3
  AVG_ROW_LENGTH = 8192
  CHARACTER SET utf8
  COLLATE utf8_unicode_ci
  ROW_FORMAT = DYNAMIC;

--
-- Описание для таблицы Roles
--
DROP TABLE IF EXISTS Roles;
CREATE TABLE Roles (
  role_id INT(11) NOT NULL AUTO_INCREMENT,
  name    VARCHAR(50)      DEFAULT NULL,
  PRIMARY KEY (role_id)
)
  ENGINE = INNODB
  AUTO_INCREMENT = 3
  AVG_ROW_LENGTH = 8192
  CHARACTER SET utf8
  COLLATE utf8_unicode_ci
  ROW_FORMAT = DYNAMIC;

--
-- Описание для таблицы Users
--
DROP TABLE IF EXISTS Users;
CREATE TABLE Users (
  user_id       INT(11)      NOT NULL AUTO_INCREMENT,
  email         VARCHAR(255) NOT NULL,
  password      VARCHAR(255)          DEFAULT NULL,
  first_name    VARCHAR(50)           DEFAULT NULL,
  last_name     VARCHAR(50)           DEFAULT NULL,
  passport_scan LONGBLOB              DEFAULT NULL,
  photo         LONGBLOB              DEFAULT NULL,
  discount      INT(11)      NOT NULL DEFAULT 0,
  phone         VARCHAR(25)           DEFAULT NULL,
  role_id       INT(11)               DEFAULT NULL,
  is_active     TINYINT(1)   NOT NULL DEFAULT 0,
  PRIMARY KEY (user_id),
  UNIQUE INDEX Users_email_uindex (email),
  CONSTRAINT FK_Users_role_id FOREIGN KEY (role_id)
  REFERENCES Roles (role_id)
    ON DELETE NO ACTION
    ON UPDATE RESTRICT
)
  ENGINE = INNODB
  AUTO_INCREMENT = 157
  AVG_ROW_LENGTH = 6593
  CHARACTER SET utf8
  COLLATE utf8_unicode_ci
  ROW_FORMAT = DYNAMIC;

--
-- Описание для таблицы Accounting
--
DROP TABLE IF EXISTS Accounting;
CREATE TABLE Accounting (
  deal_id      INT(11)       NOT NULL AUTO_INCREMENT,
  user_id      INT(11)                DEFAULT NULL,
  course_id    INT(11)                DEFAULT NULL,
  course_coast DOUBLE(16, 2) NOT NULL DEFAULT 0.00,
  debt         DOUBLE(16, 2) NOT NULL DEFAULT 0.00,
  PRIMARY KEY (deal_id),
  CONSTRAINT FK_Accounting_certificate_id FOREIGN KEY (course_id)
  REFERENCES Courses (id)
    ON DELETE NO ACTION
    ON UPDATE RESTRICT,
  CONSTRAINT FK_Accounting_user_id FOREIGN KEY (user_id)
  REFERENCES Users (user_id)
    ON DELETE SET NULL
    ON UPDATE RESTRICT
)
  ENGINE = INNODB
  AUTO_INCREMENT = 8
  AVG_ROW_LENGTH = 8192
  CHARACTER SET utf8
  COLLATE utf8_unicode_ci
  ROW_FORMAT = DYNAMIC;

--
-- Описание для таблицы Certificate
--
DROP TABLE IF EXISTS Certificate;
CREATE TABLE Certificate (
  certification_id   INT(11)    NOT NULL AUTO_INCREMENT,
  user_id            INT(11)             DEFAULT NULL,
  certification_date DATE                DEFAULT NULL,
  course_name        VARCHAR(500)        DEFAULT NULL,
  language           VARCHAR(255)        DEFAULT NULL,
  certificate_uid    BIGINT(20) NOT NULL,
  PRIMARY KEY (certification_id),
  CONSTRAINT FK_Certificate_user_id FOREIGN KEY (user_id)
  REFERENCES Users (user_id)
    ON DELETE NO ACTION
    ON UPDATE RESTRICT
)
  ENGINE = INNODB
  AUTO_INCREMENT = 92
  AVG_ROW_LENGTH = 8192
  CHARACTER SET utf8
  COLLATE utf8_unicode_ci
  ROW_FORMAT = DYNAMIC;

--
-- Описание для таблицы Payments
--
DROP TABLE IF EXISTS Payments;
CREATE TABLE Payments (
  payment_id   INT(11)       NOT NULL AUTO_INCREMENT,
  deal_id      INT(11)                DEFAULT NULL,
  amount       DOUBLE(16, 2) NOT NULL DEFAULT 0.00,
  payment_date TIMESTAMP     NULL     DEFAULT NULL,
  PRIMARY KEY (payment_id),
  CONSTRAINT FK_Payments_Accounting_deal_id FOREIGN KEY (deal_id)
  REFERENCES Accounting (deal_id)
    ON DELETE RESTRICT
    ON UPDATE RESTRICT
)
  ENGINE = INNODB
  AUTO_INCREMENT = 5
  AVG_ROW_LENGTH = 8192
  CHARACTER SET utf8
  COLLATE utf8_unicode_ci
  ROW_FORMAT = DYNAMIC;

